description:
1. Provision of capacity building to (i) small farmers and fisherfolk (SFF) (e.g., financial literacy, entrepreneurship, access to and management of loans and repayments), and (ii) SFF organizations (e.g., strategic planning, internal control systems, project identification and business planning, organizational and business management), geared towards strengthened participation in the value chain;
2. Conduct of policy studies and program/project monitoring and evaluation, advocacy and information campaign; and                           
3. Establishment of small farmer/fisher client database, and purchase of software/hardware requirement
